DROP TABLE IF EXISTS `building_informations`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `building_informations` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `building_code` varchar(255) NOT NULL COMMENT 'ビルコード',
  `language_id` int(11) NOT NULL COMMENT '言語 ID',
  `building_name` varchar(255) DEFAULT NULL COMMENT 'ビル名',
  `display_building_name` varchar(255) DEFAULT NULL COMMENT 'ビル表示名',
  `building_name_abbreviation` varchar(255) DEFAULT NULL COMMENT 'ビル名略称',
  `pref` varchar(255) DEFAULT NULL COMMENT '都道府県',
  `address` varchar(255) DEFAULT NULL COMMENT '所在地',
  `full_address` varchar(255) DEFAULT NULL COMMENT '所在地(都道府県を含む表記)',
  `appeal` text DEFAULT NULL COMMENT 'アピール',
  `scale` varchar(255) DEFAULT NULL COMMENT '建物規模',
  `completion_date` varchar(255) DEFAULT NULL COMMENT '竣工年月',
  `valid_completion_date` date DEFAULT NULL COMMENT '竣工年月',
  `extension_date` varchar(255) DEFAULT NULL COMMENT '増築年月',
  `renovation_date` varchar(255) DEFAULT NULL COMMENT '最新リニューアル完了年月',
  `no_of_floors` varchar(255) DEFAULT NULL COMMENT '規模',
  `structure` varchar(255) DEFAULT NULL COMMENT '構造',
  `gross_area` varchar(255) DEFAULT NULL COMMENT '延床面積',
  `net_area` varchar(255) DEFAULT NULL COMMENT '有効面積',
  `site_area` varchar(255) DEFAULT NULL COMMENT '敷地面積',
  `building_height` varchar(255) DEFAULT NULL COMMENT '建物高さ',
  `architect` varchar(255) DEFAULT NULL COMMENT '設計管理',
  `elevators` varchar(255) DEFAULT NULL COMMENT 'エレベーター',
  `hvac` varchar(255) DEFAULT NULL COMMENT '空調設備',
  `hvac_hours_office` varchar(255) DEFAULT NULL COMMENT '基準冷暖房供給 / 時間(事務所)',
  `hvac_hours_retail` varchar(255) DEFAULT NULL COMMENT '基準冷暖房供給 / 時間(店舗)',
  `network_infrastructure` varchar(255) DEFAULT NULL COMMENT '通信インフラ',
  `open_hours` varchar(255) DEFAULT NULL COMMENT '開閉館時間',
  `security_system` varchar(255) DEFAULT NULL COMMENT '管理形態',
  `after_hour_access` varchar(255) DEFAULT NULL COMMENT '夜間入退館方法',
  `parking_spaces` varchar(255) DEFAULT NULL COMMENT 'ガレージ収容台数',
  `parking_open_hours` varchar(255) DEFAULT NULL COMMENT 'ガレージ営業時間',
  `notes` varchar(255) DEFAULT NULL COMMENT '特記事項',
  `typical_floor_area` varchar(255) DEFAULT NULL COMMENT '床面積',
  `floor_load` varchar(255) DEFAULT NULL COMMENT '床荷重',
  `ceiling_height` varchar(255) DEFAULT NULL COMMENT '天井高',
  `outlet_capacity` varchar(255) DEFAULT NULL COMMENT 'コンセント容量',
  `oa_floor` varchar(255) DEFAULT NULL COMMENT 'OA フロア',
  `bathroom` varchar(255) DEFAULT NULL COMMENT 'トイレ',
  `pantry` varchar(255) DEFAULT NULL COMMENT '給湯室',
  `url` varchar(255) DEFAULT NULL COMMENT 'ウェブサイト URL',
  `accesses` varchar(1024) DEFAULT NULL COMMENT 'アクセス',
  `nearest_station` varchar(255) DEFAULT NULL COMMENT '最寄り駅',
  `certifications` text DEFAULT NULL COMMENT '取得済み認証',
  `meta_title` varchar(255) DEFAULT NULL COMMENT 'meta 用タイトル',
  `meta_description` varchar(255) DEFAULT NULL COMMENT 'meta 用ディスクリプション',
  `management_tel` varchar(255) DEFAULT NULL COMMENT 'ビル管理室電話番号',
  `equipments` varchar(255) DEFAULT NULL COMMENT '付帯施設',
  `keywords` varchar(255) DEFAULT NULL COMMENT '検索キーワード',
  `filename` varchar(255) DEFAULT NULL COMMENT 'ホワイトペーパーファイル名',
  `original_filename` varchar(255) DEFAULT NULL COMMENT 'ホワイトペーパーファイル名',
  `created_at` timestamp NULL DEFAULT NULL COMMENT '作成日時',
  `created_by` int(11) DEFAULT NULL COMMENT '作成ユーザー ID',
  `created_ip` varchar(255) DEFAULT NULL COMMENT '作成ホストの IP アドレス',
  `updated_at` timestamp NULL DEFAULT NULL COMMENT '更新日時',
  `updated_by` int(11) DEFAULT NULL COMMENT '更新ユーザー ID',
  `updated_ip` varchar(255) DEFAULT NULL COMMENT '更新ホストの IP アドレス',
  `deleted_at` timestamp NULL DEFAULT NULL COMMENT '削除日時',
  `deleted_by` int(11) DEFAULT NULL COMMENT '削除ユーザー ID',
  `deleted_ip` varchar(255) DEFAULT NULL COMMENT '削除ホストの IP アドレス',
  PRIMARY KEY (`id`),
  KEY `idx_building_code_language_id` (`building_code`,`language_id`)
) ENGINE=InnoDB AUTO_INCREMENT=219 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='ビル付加情報テーブル';
/*!40101 SET character_set_client = @saved_cs_client */;

