--
-- Table structure for table `buildings`
--

DROP TABLE IF EXISTS `buildings`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `buildings` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `building_code` varchar(255) NOT NULL COMMENT 'ビルコード',
  `building_name_kana` varchar(255) DEFAULT NULL COMMENT 'ビル名カナ',
  `area_code` varchar(255) DEFAULT NULL COMMENT 'オフィスビル一覧用エリアコード',
  `is_new` int(11) NOT NULL DEFAULT 0 COMMENT '新ビル区分 ID',
  `search_area_id` varchar(255) DEFAULT NULL COMMENT '検索用エリア ID',
  `search_ward_id` varchar(255) DEFAULT NULL COMMENT '検索用エリア(区) ID',
  `nearest_station_by_walk` int(11) NOT NULL DEFAULT 0 COMMENT '最寄駅からの所要時間',
  `lobby` int(11) NOT NULL DEFAULT 1 COMMENT 'オフィスロビー 1 / 2',
  `plenty_of_restaurants` int(11) NOT NULL DEFAULT 1 COMMENT '飲食施設充実 1 / 2',
  `small_area` int(11) NOT NULL DEFAULT 1 COMMENT '小規模面積あり 1 / 2',
  `not_wet_by_rain` int(11) NOT NULL DEFAULT 1 COMMENT '雨に濡れない 1 / 2',
  `vip_support` int(11) NOT NULL DEFAULT 1 COMMENT 'VIP 対応 1 / 2',
  `power_supply_blackout` int(11) NOT NULL DEFAULT 1 COMMENT '停電時のテナント専用部電力供給 1 / 2',
  `security_gate` int(11) NOT NULL DEFAULT 1 COMMENT 'セキュリティゲート 1 / 2',
  `refreshment_space` int(11) NOT NULL DEFAULT 1 COMMENT 'テナント専用ラウンジ 1 / 2',
  `renewable_energy` int(11) NOT NULL DEFAULT 1 COMMENT '再エネ導入ビル 1 / 2',
  `certified` int(11) DEFAULT 1 COMMENT '認証取得済み 1 / 2',
  `service_enabled` int(11) DEFAULT 1 COMMENT 'サービス付き 1 / 2',
  `showing_priority` int(11) NOT NULL DEFAULT 1 COMMENT '検索結果上の優先表示',
  `office_support` varchar(255) DEFAULT NULL COMMENT 'オフィスサポート施設',
  `visible_office_site` int(11) DEFAULT NULL COMMENT 'オフィス情報サイト表示フラグ',
  `disaster_prevention_center` varchar(255) DEFAULT NULL COMMENT '防災センター番号',
  `latitude` double DEFAULT NULL COMMENT '緯度',
  `longitude` double DEFAULT NULL COMMENT '経度',
  `google_street_view_url` varchar(255) DEFAULT NULL COMMENT 'Google ストリートビュー URL',
  `google_street_view_tag` varchar(255) DEFAULT NULL COMMENT 'Google ストリートビュー 埋め込みタグ',
  `vr_url` varchar(512) DEFAULT NULL COMMENT 'VR 用 URL',
  `movie_url` varchar(512) DEFAULT NULL COMMENT '動画用 URL',
  `area_size` double(8,2) NOT NULL DEFAULT 0.00 COMMENT '基準階面積',
  `approve_status_id` int(11) NOT NULL DEFAULT 1 COMMENT '承認ステータス',
  `translation_status_id` int(11) NOT NULL DEFAULT 1 COMMENT '翻訳ステータス',
  `recommend` tinyint(4) NOT NULL DEFAULT 0 COMMENT 'おすすめ物件フラグ',
  `is_updated` tinyint(4) NOT NULL DEFAULT 0 COMMENT '追加情報未登録フラグ',
  `published` tinyint(4) DEFAULT 0,
  `created_at` timestamp NULL DEFAULT NULL COMMENT '作成日時',
  `created_by` int(11) DEFAULT NULL COMMENT '作成ユーザー ID',
  `created_ip` varchar(255) DEFAULT NULL COMMENT '作成ホストの IP アドレス',
  `updated_at` timestamp NULL DEFAULT NULL COMMENT '更新日時',
  `updated_by` int(11) DEFAULT NULL COMMENT '更新ユーザー ID',
  `updated_ip` varchar(255) DEFAULT NULL COMMENT '更新ホストの IP アドレス',
  `deleted_at` timestamp NULL DEFAULT NULL COMMENT '削除日時',
  `deleted_by` int(11) DEFAULT NULL COMMENT '削除ユーザー ID',
  `deleted_ip` varchar(255) DEFAULT NULL COMMENT '削除ホストの IP アドレス',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=110 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='ビル基本情報テーブル';
/*!40101 SET character_set_client = @saved_cs_client */;

