DROP TABLE IF EXISTS `chargers`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `chargers` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `building_code` varchar(255) NOT NULL COMMENT 'ビルコード',
  `language_id` int(11) NOT NULL COMMENT '言語 ID',
  `charger_department` varchar(255) DEFAULT NULL COMMENT '担当部署名',
  `charger_name` varchar(255) DEFAULT NULL COMMENT '担当者名',
  `charger_tel` varchar(255) DEFAULT NULL COMMENT '担当者電話番号',
  `charger_email` varchar(255) DEFAULT NULL COMMENT '担当者メールアドレス',
  `created_at` timestamp NULL DEFAULT NULL COMMENT '作成日時',
  `created_by` int(11) DEFAULT NULL COMMENT '作成ユーザー ID',
  `created_ip` varchar(255) DEFAULT NULL COMMENT '作成ホストの IP アドレス',
  `updated_at` timestamp NULL DEFAULT NULL COMMENT '更新日時',
  `updated_by` int(11) DEFAULT NULL COMMENT '更新ユーザー ID',
  `updated_ip` varchar(255) DEFAULT NULL COMMENT '更新ホストの IP アドレス',
  `deleted_at` timestamp NULL DEFAULT NULL COMMENT '削除日時',
  `deleted_by` int(11) DEFAULT NULL COMMENT '削除ユーザー ID',
  `deleted_ip` varchar(255) DEFAULT NULL COMMENT '削除ホストの IP アドレス',
  PRIMARY KEY (`id`),
  KEY `idx_building_code_language_id` (`building_code`,`language_id`)
) ENGINE=InnoDB AUTO_INCREMENT=315 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='担当者テーブル';
