INSERT INTO `content_page_values` VALUES (1,'特集物件','lead','見出し','single',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(2,'特集物件','feature','TOKYO TORCH','multiple','TOKYO TORCH',NULL,NULL,'TOKYO TORCH（東京駅前 常盤橋プロジェクト）は、東京駅周辺で最大となる大規模複合再開発です。大手町・丸の内・八重洲・日本橋に囲まれた、東京の中心・常盤橋。JR 東京駅（日本橋口）目の前に、日本最大級の高層ビルや7,000㎡の広場が姿を現し、圧倒的なスケールで東京の新たなシンボルが誕生します。日本の新たなランドマーク「TOKYO TORCH」。',NULL,NULL,'/storage/library/img_tokiwabashi.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'/tokiwabashi/index.html',0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-31 14:25:33',1,'192.168.100.31',NULL,NULL,NULL),(3,'特集物件','feature','3rd MINAMI AOYAMA','multiple','3rd MINAMI AOYAMA',NULL,NULL,'最先端のトレンドと洗練されたカルチャーが息づく青山に、総面積約2,400 ㎡の敷地、地上13階の上質なオフィスビル「3rd MINAMI AOYAMA」が誕生。オフィスは、渋谷と赤坂を結ぶ「青山通り」と青山文化の発信地の一つである「外苑西通り」の交差点付近で、青山通りと外苑西通りの双方からアプローチが可能。自由なレイアウトでクリエイティビティを高め、外気を感じながら打合せが可能なアウターバルコニーと明るく開放感あふれるインナーバルコニーなどを備えた感性を刺激するオフィスです。',NULL,NULL,'/storage/library/img_minamiaoyama3.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'/minamiaoyama3/index.html',0,2,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(4,'特集物件','feature','フロントプレイス四谷','multiple','フロントプレイス四谷',NULL,NULL,'2023年2月、新宿通り沿いに新たなランドマーク「フロントプレイス四谷」が誕生しました。ビジネスの入り口として相応しい品格を携えたエントランスでは、オフィス来訪者と店舗の動線を分離することで、働く人とお客様を心地よくお迎えします。オフィスは、都会の中で解放感を感じられる就業者専用の屋上庭園テラスを整備すると共に、BCP対策も充実しています。新宿通りからの視認性が高く、就業者向け施設も充実した、四谷エリアでも特徴を持ったオフィスを提供します。',NULL,NULL,'/storage/library/img_yotsuya.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'/yotsuya/index.html',0,3,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(5,'特集物件','feature','（仮称）内神田一丁目計画','multiple','（仮称）内神田一丁目計画',NULL,NULL,'大手町との結節点に位置し、神田エリアのシンボルタワーとなる「（仮称）内神田一丁目計画」。三層吹き抜けの開放的なオフィスエントランスには天然の木材を多く使用し、品格を備えながらも温かみのある空間を演出。600坪を超える無柱空間が広がるフロアプレートは、多様な働き方に合わせたレイアウトを実現可能。2駅9路線の多彩なアクセスを享受する立地には約1,000㎡の広場や船着場を整備し、新たな賑わいをもたらします。',NULL,NULL,'/storage/library/img_uchikanda1.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'/uchikanda1/',0,4,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(6,'特集物件','feature','（仮称）大阪三菱ビル建替え計画','multiple','（仮称）大阪三菱ビル建替え計画',NULL,NULL,'大阪の中心に水都大阪のシンボルとなるランドマーク「（仮称）大阪三菱ビル建替え計画」が誕生。高層階に宿泊施設、中層階にオフィス、低層階に店舗を配し、開放感のあるエントランスでみなさまをお迎えします。地上32階建て、高さ143ｍを誇り、大阪を象徴する「御堂筋」、伝統ある「堂島川」の新たな顔となるエリア有数の充実の施設です。大阪のビジネスの中心である梅田、淀屋橋から徒歩圏内、大阪市役所、日本銀行、裁判所といった主要官公庁にも至近と充実したアクセス。ワンフロア約530坪の無柱空間に、フレキシブルにレイアウトができる等ニューノーマル時代のワークスタイルに合わせた、成果を生み出すワークプレイスがここで実現できます。',NULL,NULL,'/storage/library/img_om4.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'/om4/index.html',0,5,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(7,'特集物件','archive','丸の内二重橋ビル','multiple','丸の内二重橋ビル',NULL,NULL,'歴史ある東京會舘・東京商工会議所を低層に構え、皇居外苑を見渡せる開放感あふれる上質なオフィス空間を有する「丸の内二重橋ビル」。バンケットや会議室、物販・飲食店舗も備わり、多様な働き方に柔軟に対応します。二重橋駅直結、日比谷駅、有楽町駅、東京駅、大手町駅も地下で接続と、アクセスも良好。オフィスフロアには様々なサービスが揃ったプレミアオフィスシリーズ（小規模オフィス・サービスオフィス）も展開しています。最高の環境が生み出す、新しいワークスタイルがここにあります。',NULL,NULL,'/storage/library/img_nijubashi.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'/nijubashi/index.html',0,1,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(8,'特集物件','archive','msb-Tamachi','multiple','msb-Tamachi',NULL,NULL,'豊かな緑、ラグジュアリーホテル、保育園、ジム等、働く人々をサポートする多彩な施設が充実している駅前大型複合開発「msb Tamachi」。JR田町駅改札口から徒歩1分と圧倒的なアクセスの良さ。港区芝浦に位置し、田町・三田エリアという利便性の高いこのエリアで、仕事をより快適に効率良くこなす「新しい働き方」が実現し、日本のビジネスに新たなイノベーションを起こす、国際都市東京の新たなランドマークとなるオフィスビルです。',NULL,NULL,'/storage/library/img_msb-tamachi.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'/msb-tamachi/',0,2,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(9,'特集物件','archive','日比谷国際ビル','multiple','日比谷国際ビル',NULL,NULL,'丸の内・銀座・霞が関・新橋・虎ノ門という都内主要エリアで「日比谷国際ビル」がリニューアルオープン。内幸町駅・霞が関駅に直結というアクセスの良いビルに、約150坪のテナント専用ビジネスサポートラウンジや、最大200名着席可能な貸会議室を新たに設置。日比谷公園を臨む、環境良好のオフィスビルです。',NULL,NULL,'/storage/library/img_hibiya_kokusai.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'/hibiya_kokusai/index.html',0,3,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(10,'特集物件','archive','大手町パークビルディング','multiple','大手町パークビルディング',NULL,NULL,'壮大な皇居ビューを堪能できる心地よい景観と風格を有する「大手町パークビル」。地下鉄5路線が乗り入れる大手町駅に直結しアクセスも良好。大規模はもちろん、最小約30坪からの小規模オフィスにも対応し耐震性も通常の超高層ビルの1.5倍レベルで極めて高いオフィスビルです。テナント専用ラウンジ、最高級のレジデンス・サービスアパートメントなど、職住近接が可能なビジネススタイルを実現する設備が魅力です。',NULL,NULL,'/storage/library/img_otemachi_park.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'/otemachi_park/',0,4,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(11,'特集物件','archive','大手町フィナンシャルシティグランキューブ','multiple','大手町フィナンシャルシティグランキューブ',NULL,NULL,'大規模オフィスはもちろん、最小約30坪からの小規模オフィスも対応した、ハイグレードオフィスビル「グランキューブ」。東京駅まで地下接続・大手町駅直結、首都高速出入口すぐといった、交通利便性も魅力です。また、災害時にも機能する強力な設備を備えており、丸の内エリア全体のBCP（事業継続計画）に貢献する「防災拠点ビル」の役割を担っています。',NULL,NULL,'/storage/library/img_grand_cube.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'/grand_cube/index.html',0,5,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(12,'三菱地所のフレキシブルオフィス','lead','見出し','single',NULL,NULL,NULL,'三菱地所では、東京都内（丸の内・大手町・有楽町等）を中心に、\n様々なニーズに対応したフレキシブルオフィスを取り揃えています。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(13,'三菱地所のフレキシブルオフィス','premier','The Premier Floor','single',NULL,NULL,NULL,'The Premier Floor は「丸の内ビルディング」、「大手町パークビルディング」、\r\n「丸の内二重橋ビル」、「常盤橋タワー」の計4拠点に展開。\r\nそれぞれのビルの立地や環境を活かした、付加価値の高い空間をご用意しています。',NULL,NULL,'/storage/small_office/pU4kERluzPztsgC0vyjS0YkeHOoO2FiNv3rLJFuv.jpg','/storage/small_office/lineup/office-child2-img2.png',NULL,NULL,NULL,'/storage/small_office/lineup/office-child2-img1-sp.png','/storage/small_office/lineup/office-child2-img2-sp.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-14 15:21:19',2,'192.168.100.31',NULL,NULL,NULL),(14,'三菱地所のフレキシブルオフィス','xLINK','xLINK','single',NULL,NULL,NULL,'xLINK（クロスリンク）は「新大手町ビル」、「丸の内二丁目ビル」、「国際ビル」、\n「常盤橋タワー」、「丸の内パークビル」、「岸本ビル」の計6拠点に展開。\n什器付のオフィス区画と、受付・会議室・ラウンジエリアからなるサービス付フレキシブルオフィスです。\nそれぞれのビルの立地や環境を活かした、洗練された上質な空間をご用意しています。',NULL,NULL,'/storage/small_office/lineup/office-child1-img1.png','/storage/small_office/lineup/office-child1-img2.png',NULL,NULL,NULL,'/storage/small_office/lineup/office-child1-img1-sp.png','/storage/small_office/lineup/office-child1-img2.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(15,'三菱地所のフレキシブルオフィス','co-working','コワーキングスペース','single',NULL,NULL,NULL,'国内外のスタートアップの事業成長を支援する、コミュニティ型サービスオフィスを運営しています。',NULL,NULL,'/storage/small_office/lineup/office-child3-img1.png','/storage/small_office/lineup/office-child3-img2.png',NULL,NULL,NULL,'/storage/small_office/lineup/office-child3-img1-sp.png','/storage/small_office/lineup/office-child3-img2.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(16,'三菱地所のフレキシブルオフィス','compact-office','コンパクトオフィスシリーズ','single',NULL,NULL,NULL,'CIRCLES はサービスオフィス等が手狭となった成長企業や、\n働き方改革に伴うコラボレーションオフィスや分室ニーズを持つ企業に最適な、中小規模オフィスビルシリーズです。\n家具付きフロアやテラス・カフェ等の共用空間等、多様な空間をご用意しております。',NULL,NULL,'/storage/small_office/lineup/office-child4-img1.png','/storage/small_office/lineup/office-child4-img2.png',NULL,NULL,NULL,'/storage/small_office/lineup/office-child4-img1-sp.png','/storage/small_o