BOX','multiple','「イノベーション都市・横浜」の実現に向けた\nベンチャー企業の成長支援拠点',NULL,NULL,NULL,NULL,NULL,'/storage/small_office/co-working/img8.png','/storage/small_office/co-working/logo8.svg',NULL,NULL,NULL,NULL,'/storage/small_office/co-working/logo8-sp.svg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://www.mec.co.jp/company/branch/yokohama/yoxobox/',0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(56,'ワーケーション・テレキューブ','lead','見出し','single',NULL,NULL,NULL,'場所に捉われない新しい働き方が一般的になると同時に、そうした働き方にあったオフィス形態やサービスが求められるようになっています。三菱地所では、地方と都市の新たな関係を生み出し、新しい働き方を提案するワーケーション、どこでもオフィスになる「テレキューブ」等、さまざまな働き方のニーズに応えるサービスをご提供しております。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(57,'ワーケーション・テレキューブ','workation','01 ワーケーション','single',NULL,NULL,NULL,'ワーケーションとは、「ワーク（Work）」と「バケーション（Vacation）」を組み合わせた欧米発の新しい働き方です。三菱地所では、ワーケーションを「Work 質を高め、様々なation を生み出す働き方」を定義し、人を、企業を、そして社会をより豊かにする新しいワークスタイルとしてご提案します。',NULL,NULL,'/storage/small_office/workation/logo1.svg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(58,'ワーケーション・テレキューブ','workation-images','ワーケーション画像リスト','single',NULL,NULL,NULL,NULL,NULL,NULL,'/storage/small_office/workation/work6.png','/storage/small_office/workation/work7.png','/storage/small_office/workation/work8.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'開発合宿','オフサイトミーティング','CSR活動',NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(59,'ワーケーション・テレキューブ','workation-conclude','ワーケーションまとめ','single',NULL,NULL,NULL,'これまでにない新しい働き方を実施する場所、それが「WORK x ationSite」です。\nミーティングスペースや、通信環境など、いつも変わらないオフィス環境の中、普段と違う場所で、\n普段の関係を超えたコミュニケーションが刺激となり、日常では出ない発想。成果が創り出される。\nそれが、チームメンバーのモチベーションを向上させ、これまでにないクリエイティブな循環が生まれる。\n人気のエリアに展開される「WORK x ationSite」で、みなさまに合ったワーケーションをプランニングし、\nこれまでにないイノベーションを起こしてみませんか？ ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(60,'ワーケーション・テレキューブ','telecube','02 いつでもどこでも働けるテレキューブ','single',NULL,NULL,NULL,'「テレキューブ」は、あらゆる場所に容易に設置できる、防音型のスマートワークブースです。\n内部にはテーブル、イス、電源コンセントなどがあり、\nセキュリティが保たれた静かな環境で、資料作成やメールなどの業務や、\n電話、Web 会議などでのコミュニケーションが可能です。駅・空港・オフィスビルエントランス・商業施設などの\n公共空間への設置を進めており、「いつでも」「どこでも」働けるテレワークに理想的な環境を提供しています。 ','オフィス内へも、Web 会議対応スペースとして工事不要で気軽に導入することができるため、\nWeb 会議の普及によりオフィス内で発生しつつある「個室が足りない」\n「オープンスペースで周りに迷惑をかける」といった問題を解決できます。\nレイアウト変更時にも、筐体を動かすだけで済むので大規模な工事は必要ありません。 ',NULL,'/storage/small_office/workation/telecube1.png','/storage/small_office/workation/telecube2.png',NULL,NULL,NULL,NULL,'/storage/small_office/workation/telecube2-sp.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(61,'ワーケーション・テレキューブ','telecube-images','テレキューブ画像リスト','single',NULL,NULL,NULL,NULL,NULL,NULL,'/storage/small_office/workation/work11.png','/storage/small_office/workation/work12.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(62,'安全・安心へのこだわり','lead','見出し','single',NULL,NULL,NULL,'三菱地所は、ビル・人・地域のすべてがひとつになってこそ\n真の安全が生まれると考え、安心して働ける環境づくりに取り組んでいます。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(63,'安全・安心へのこだわり','bcp','BCP 対策','single',NULL,NULL,NULL,'三菱地所は、1894年竣工の三菱一号館から培ってきた\n「安全・安心の想い」を、図面を引くところから日々の管理に至るまで、\n街を訪れる様々な人の目線に立って実現し続けます。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.