/concept/eco/img1.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(81,'環境への配慮と取り組み','section03','三菱地所の再エネ電力導入ビルの特徴 02','single','テナント様の追加費用負担はゼロ',NULL,NULL,'当社の再エネ電力導入ビルでは、テナント様に追加のコスト負担を頂くこと無く、\n再エネ電力をご利用頂けます（＝環境価値を主張することが可能です）。 ','※電気使用料自体は、電力価格の著しい高騰や電力市場における需給バランスの大幅な変化等により、変動の可能性有り。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(82,'環境への配慮と取り組み','section04','02 認証取得済みビル','single','【運営元】株式会社日本政策投資銀行、一般社団法人 日本不動産研究所',NULL,NULL,'三菱地所では、オフィスビルの各種認証取得を進めています。ソフト面の評価も含めた総合的な認証である\n「DBJ Green Building認証」の取得実績も多数ございます。',NULL,NULL,'/storage/concept/eco/img2.png',NULL,NULL,NULL,NULL,'/storage/concept/eco/img2-sp.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(83,'環境への配慮と取り組み','section05','廃棄物再利用率 100％「サーキュラーシティ丸の内」','single','廃棄物再利用率 100％「サーキュラーシティ丸の内」',NULL,NULL,'当社は、2030 年までに廃棄物再利用率 100％、単位面積当たり廃棄物排出量 20％削減達成を掲げており、\n丸の内エリアで「資源循環」に着目した取組みを進めています。',NULL,NULL,'/storage/concept/eco/img3.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(84,'環境への配慮と取り組み','section06','具体取組','single','MARUNOUCHI TO GO プロジェクト','Bottle to Bottle リサイクルサーキュレーション',NULL,'食べきれなかった料理の持ち帰り用容器 TO GO BOX や紙袋を無償配布して食品ロス削減につなげる','丸の内エリアのオフィスビルで排出されたペットボトルを、新たなペットボトルに再生する',NULL,'/storage/concept/eco/img4.png','/storage/concept/eco/img5.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(85,'環境への配慮と取り組み','section07','03 人と環境にやさしい快適な空間づくり 1','single','快適な室内環境を維持',NULL,NULL,NULL,NULL,NU