/business_power/concentration2-sp.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(118,'世界有数のビジネス力','section04-images','国内時価総額上位50位企業本社数','multiple','国内時価総額上位50位企業本社数','※2022年3月時点当社調べ',NULL,'大丸有エリア（丸の内・大手町・有楽町）における国内時価総額上位50位の企業本社数は、\n東京の他のビジネスエリアと比べ最多となっています。',NULL,NULL,'/storage/area/business_power/concentration3.png',NULL,NULL,NULL,NULL,'/storage/area/business_power/concentration3-sp.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(119,'世界有数のビジネス力','section04-images','外国金融機関事業所数','multiple','外国金融機関事業所数','※2022年3月時点当社調べ',NULL,'大丸有エリア（丸の内・大手町・有楽町）に存在する外国金融機関事業所数は72社を誇り、\n日本最大の国際金融センターとなっています。',NULL,NULL,'/storage/area/business_power/concentration4.png',NULL,NULL,NULL,NULL,'/storage/area/business_power/concentration4-sp.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(120,'丸の内エリアの防災力','lead','見出し','single',NULL,NULL,NULL,'三菱地所グループでは、丸の内エリア全体での安全性を確保するため、BCD（Business Continuity District：事業継続基盤\n強化地区）という考え方を導入し、来訪者を守りテナントの事業活動を止めないハードの整備に加え、災害情報の収集・発信\nや負傷者対応などのソフト面でも公民連携し、高度な防災機能を実現出来るよう対策に取り組んでいます。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(121,'丸の内エリアの防災力','section01','01 災害に強い丸の内エリア','single',NULL,NULL,NULL,'東京都の調査によると、丸の内エリアは「建物倒壊危険度」と「地震火災危険度」がともに低く、\n総合危険度は最も低い「ランク1」エリアとなっています。',NULL,NULL,'/storage/area/disaster_prevention/section01_img.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(122,'丸の内エリアの防災力','section02','02 「面的」防災対策','single',NULL,NULL,NULL,'丸の内エリアでは、災害時に地区の拠点となる高度な防災力を有する「エリア防災ビル」を確保しております。\nまた官民連携による、ローカル情報を含めた情報収集・編集・編成・配信を担う情報HUB機能を設け、\nICTの面からも災害に強いエリアとなっています。 ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(123,'丸の内エリアの防災力','section02-1','02 エリア全体のBCP に貢献する「防災拠点ビル」','single','エリア全体のBCP に貢献する「防災拠点ビル」',NULL,NULL,'周辺ビルとの連携でエリア全体により強固な防災機能を実現。\n連携の中心に三菱地所の「防災拠点ビル」があります。 ',NULL,NULL,'/storage/area/disaster_prevention/section02_img1.jpg',NULL,NULL,NULL,NULL,'/storage/area/disaster_prevention/section02_img1_sp.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(124,'丸の内エリアの防災力','section02-2','02 官民連携による情報HUB機能を有する次世代防災拠点の形成','single','官民連携による情報HUB機能を有する次世代防災拠点の形成',NULL,NULL,NULL,NULL,NULL,'/storage/area/disaster_prevention/section02_img2.jpg',NULL,NULL,NULL,NULL,'/storage/area/disaster_prevention/section02_img2_sp.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(125,'丸の内エリアの防災力','section02-3','02 広域・ローカル情報を集約する災害ダッシュボード','single','広域・ローカル情報を集約する災害ダッシュボード',NULL,NULL,NULL,NULL,NULL,'/storage/area/disaster_prevention/section02_img3.jpg',NULL,NULL,NULL,NULL,'/storage/area/disaster_prevention/section02_img3_sp.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(126,'丸の内エリアの防災力','section03','03 企業の事業継続を支援する電力供給網','single',NULL,NULL,NULL,'テナント企業の事業継続を支援するネットワーク化された電力供給網、およびバックアップ電源を確保しています。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(127,'丸の内エリアの防災力','section03-1','03 エリア全体のBCP に貢献する「防災拠点ビル」','single','複数回線からの安定的な電力供給',NULL,NULL,'エリア内の多くのビルでは、「本線・予備線方式」や「ループ方式」といった信頼性の高い受電方式を採用。送電ルートのトラブルにより受電が途絶えても別の回線に切り替えることで受電を継続することが可能です。',NULL,NULL,'/storage/area/disaster_prevention/sec3_img1.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(128,'丸の内エリアの防災力','section03-2','03 非常用発電機燃料の多重化','single','非常用発電機燃料の多重化',NULL,NULL,'系統電力からの供給が途絶えた場合、東日本大震災の被災地においても損傷がなかった、耐震性に優れた中圧導管から供給される中圧ガスを燃料とした発電も可能とするデュアルフューエル方式の発電機、もしくはコージェネレーションシステム（CGS）を、2011 年東日本大震災以降に着工したビル全てに導入しています。',NULL,NULL,'/storage/area/disaster_prevention/sec3_img2.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(129,'丸の内エリアの防災力','section03-3','03 大容量のオイルタンクの実装','single','大容量のオイルタンクの実装',NULL,NULL,'エネルギーインフラが復旧するとされる72時間、電力供給を途絶えさせないために、非常用発電機および、それを稼働させるための大容量の重油を備蓄しております。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(130,'丸の内エリアの防災力','oil-tank','大容量オイルタンク 常盤橋タワー','multiple','常盤橋タワー',NULL,NULL,NULL,NULL,NULL,'/storage/area/disaster_prevention/sec3_building1.jpg',NULL,NULL,NULL,NULL,'/storage/area/disaster_prevention/sec3_building1_sp.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(131,'丸の内エリアの防災力','oil-tank','大容量オイルタンク 大手町FC グランキューブ','multiple','大手町FC グランキューブ',NULL,NULL,NULL,NULL,NULL,'/storage/area/disaster_prevention/sec3_building2.jpg',NULL,NULL,NULL,NULL,'/storage/area/disaster_prevention/sec3_building2_sp.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(132,'丸の内エリアの防災力','oil-tank','大容量オイルタンク 丸の内パークビルディング','multiple','丸の内パークビルディング',NULL,NULL,NULL,NULL,NULL,'/storage/area/disaster_prevention/sec3_building3.jpg',NULL,NULL,NULL,NULL,'/storage/area/disaster_prevention/sec3_building3_sp.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(133,'丸の内エリアの防災力','oil-tank','大容量オイルタンク 丸の内永楽ビルディング','multiple','丸の内永楽ビルディング',NULL,NULL,NULL,NULL,NULL,'/storage/area/disaster_prevention/sec3_building4.jpg',NULL,NULL,NULL,NULL,'/storage/area/disaster_prevention/sec3_building4_sp.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(134,'丸の内エリアの防災力','section04','04 安定性の高いエネルギーネットワーク','single',NULL,NULL,NULL,'エリア内の多くのビルでは、当社グループ（丸の内熱供給株式会社）による地域冷暖房システムを採用し、\nそのプラントや配管は地震の影響を受けにくい、地下20～30mに位置する耐震性の高い構造体内に設置されています。\nまたプラント間は、供給配管系統をネットワーク化し、バックアップ体制を構築、\nさらに、専門スタッフが24時間体制で常駐管理をしています。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(135,'丸の内エリアの防災力','section04-1','04 コジェネレーションシステム・排熱利用','single','コジェネレーションシステム・排熱利用',NULL,NULL,'プラントは、事故・災害時により電力会社から電力供給が遮断された場合、非常用発電機やコジェネレーションシステム等から電力供給を受けることで一定量の熱供給が可能となります。コジェネレーションシステムは、平時も稼働させているため、非常時運転への切り替えもスムーズに行えます。また、排熱を熱供給網に接続することでエリアで面的に融通することができ、エネルギーの有効活用も図っております。',NULL,NULL,'/storage/area/disaster_prevention/sec4_img1.jpg',NULL,NULL,NULL,NULL,'/storage/area/disaster_prevention/sec4_img1_sp.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(136,'丸の内エリアの防災力','section04-2','04 大丸有エリアのエネルギーネットワーク【SUPER TUBE】','single','大丸有エリアのエネルギーネットワーク【SUPER TUBE】',NULL,NULL,'冷温水・蒸気配管を集約した洞道及び配管ネットワークの総称｢SUPER TUBE｣。効率的で信頼性の高いエネルギーネットワークでエリアの防災性能と環境性能を高めています。',NULL,NULL,'/storage/area/disaster_prevention/sec4_logo.svg','/storage/area/disaster_prevention/sec4_img2.jpg',NULL,NULL,NULL,NULL,'/storage/area/disaster_prevention/sec4_img2_sp.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(137,'丸の内エリアの防災力','section05','05 より安全なまちづくりのために「3.11を忘れない」','single','より安全なまちづくりのために「3.11を忘れない」',NULL,NULL,'1923年の関東大震災の際に、旧丸ビルやその周辺で飲料水の提供や炊き出し、臨時診療所の開設を行ったことが、三菱地所の防災対策の始まりになります。\n2011年3月に発生した東日本大震災では、社員自らが判断して、ビルの空調を翌日まで連続運転し、共用部照明の点灯・トイレの開放・ブルーシートの提供などを行いました。また、周辺店舗からの食糧供給という心強いサポートもあり、ビルに集まってきた人々へ休める場所を提供できたため、多くの帰宅困難者を受け入れることができました。\n安全なビルがあるだけではなく、そこにいる人、周辺店舗を含めた街・地域が一体となって災害に立ち向かった瞬間であり、私たちが掲げる「ビル、人、地域。すべてがひとつになってこそ真の安全が生まれる」という考えが具現化した一例であったと考えています。\n三菱地所は「安全・安心」を企業文化と位置付け、愚直に対策を積み重ねてきた歴史があるからこそ、地震対策やその他災害への意識の高さの表れが社員たちの行動にもつながっています。 三菱地所は、さらなら安全・安心を求めて、これからも防災対策を強化していきます。 ',NULL,NULL,'/storage/area/disaster_prevention/sec4_img3.png','/storage/area/disaster_prevention/sec4_img4.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(138,'オープンイノベーションフィールド','lead','見出し','single',NULL,NULL,NULL,'三菱地所は、2020年代における丸の内エリア（大手町・丸の内・有楽町地区）のまちづくりを「丸の内NEXTステージ」と位置づけ、\n“丸の内Reデザイン＝人・企業が集まり交わることで新たな「価値」を生み出す舞台づくり”を推進しています。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(139,'オープンイノベーションフィールド','section01','01 オープンイノベーションの推進','single','複数回線からの安定的な電力供給',NULL,NULL,'三菱地所は、多様な人・企業が集い、交流することを通じて進化していくまちを目指し、丸の内エリアの「オープンイノベーションフィールド」化を進めております。 ',NULL,NULL,'/storage/area/innovation/promotion1.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(140,'オープンイノベーションフィールド','section01-1','01 X TECH','single',NULL,NULL,NULL,'大手企業が集まる丸の内エリアのリソースを生かし、国内外のスタートアップ企業を対象としたビジネス開発支援施設を運営しています。オリジナル記事やイベント情報、ニュースも配信しています。',NULL,NULL,'/storage/area/innovation/promotion-logo1.svg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(141,'オープンイノベーションフィールド','section01-2','01 TMIP','single',NULL,NULL,NULL,'TMIPは、丸の内エリアのイノベーション･エコシステム形成に向けて、大企業とスタートアップ･官･学が連携して社会課題を解決することで、グローバルなマーケットに向けたイノベーションの創出を支援するプラットフォームです。',NULL,NULL,'/storage/area/innovation/promotion-logo2.svg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(142,'オープンイノベーションフィールド','co-working','三菱地所のコワーキングスペース','single',NULL,NULL,NULL,'三菱地所では、オープンイノベーションを推進する\nコミュニケーション形成型コワーキングスペースを提供しています。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(143,'オープンイノベーションフィールド','section02-1','02 ローカル5Gの整備と活用','single','＜ローカル5Gの整備と活用＞','ローカル 5G の整備拠点と活用（実証実験）イメージ',NULL,'丸の内エリアの屋内外の複数拠点に「ローカル 5G」を構築し、さまざまな企業や大学、団体との共同実証実験を通じて、\nロボットの遠隔操作などにおける活用を検討しています。',NULL,NULL,'/storage/area/innovation/advanced-technology1.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(144,'オープンイノベーションフィールド','section02-2','02 ロボットフレンドリーな環境づくり','single','＜ロボットフレンドリーな環境づくり＞','ロボットフレンドリーな環境構築に向けた取り組みのイメージ',NULL,'スマートシティにおける先進的サービス提供を支え、オンライン・オフラインともに\nアクセス可能なロボットを導入しやすくする「ロボットフレンドリー」な環境づくりを推進し、\n施設や街とロボットが連携した新しいサービスを提供していきます。\n行政やテナント企業、ロボットメーカー、警備会社、清掃会社など、\nステークホルダー間の連携のハブを当社が担い、次世代型まちづくりを推進していきます。',NULL,NULL,'/storage/area/innovation/advanced-technology2.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(145,'オープンイノベーションフィールド','robots','配送ロボット YUNJI GOGO','multiple',NULL,NULL,NULL,NULL,NULL,NULL,'/storage/area/innovation/advanced-technology3.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'配送ロボット YUNJI GOGO',NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(146,'オープンイノベーションフィールド','robots','警備ロボット SQ2','multiple','丸の内パークビルディング',NULL,NULL,NULL,NULL,NULL,'/storage/area/innovation/advanced-technology4.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'警備ロボット SQ2',NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(147,'オープンイノベーションフィールド','robots','大容量オイルタンク 丸の内永楽ビルディング','multiple','自動運搬ロボット',NULL,NULL,NULL,NULL,NULL,'/storage/area/innovation/advanced-technology5.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'自動運搬ロボット',NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(148,'上質な非日常空間','lead','見出し','single',NULL,NULL,NULL,'丸の内エリアは、ビジネスだけではなく、ファッション・グルメ・アート・エンターテインメント・ウェルネスなど、\n多彩な色を持ったまちへと日々進化しています。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(149,'上質な非日常空間','section01','01 丸の内のイベント','single','複数回線からの安定的な電力供給',NULL,NULL,'四季の移り変わりや、スポーツの熱狂を感じられるイベントなど、\nプライベートライフを彩る様々な賑わいも魅力です。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(150,'上質な非日常空間','section01-1','01 Marunouchi Street Park','single',NULL,NULL,NULL,'「Marunouchi Street Park」は、2019年からスタートした、丸の内仲通りを来街者の人々が快適に過ごすことができる広場に変貌させ、今後のあり方や活用方法等を探る社会実験です。毎回異なるコンセプトを掲げ、街に新たな魅力を吹き込むと共に、様々な取り組みにチャレンジをしています。',NULL,NULL,'/storage/area/amenity/img7.png','/storage/area/amenity/img8.jpg','/storage/area/amenity/img9.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(151,'上質な非日常空間','section01-slide','01 スライド','multiple',NULL,NULL,NULL,NULL,NULL,NULL,'/storage/area/amenity/slide1.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'仲通り綱引き大会',NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(152,'上質な非日常空間','section01-slide','01 スライド','multiple',NULL,NULL,NULL,NULL,NULL,NULL,'/storage/area/amenity/slide2.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'丸の内盆踊り',NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(153,'上質な非日常空間','section01-slide','01 スライド','multiple',NULL,NULL,NULL,NULL,NULL,NULL,'/storage/area/amenity/slide3.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'大手町縁日',NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(154,'上質な非日常空間','section01-slide','01 スライド','multiple',NULL,NULL,NULL,NULL,NULL,NULL,'/storage/area/amenity/slide4.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'サンタパレード',NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(155,'上質な非日常空間','section01-slide','01 スライド','multiple',NULL,NULL,NULL,NULL,NULL,NULL,'/storage/area/amenity/slide5.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'仲通りイルミネーション',NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(156,'上質な非日常空間','section02','02 アート・音楽との触れ合い','single',NULL,NULL,NULL,'丸の内エリアは、街を歩くだけで楽しめるアート作品や、昔ながらの姿を残す美術館、街の音楽祭など、芸術に触れる機会がたくさんあります。 ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(157,'上質な非日常空間','section02-1','02 丸の内ストリートギャラリー','single','丸の内ストリートギャラリー',NULL,NULL,'公益財団法人彫刻の森芸術文化財団と三菱地所は芸術性豊かな街づくりを目指し、1972年から数年に一度、作品の入れ替えを行い「丸の内ストリートギャラリー」を実施しています。丸の内仲通りをメインに、近代彫刻の巨匠の作品や世界で活躍する現代アーティストの作品を展示しています。丸の内を散策しながら、アートを身近に体感してみませんか？',NULL,NULL,'/storage/area/amenity/img12.svg','/storage/area/amenity/img13.jpg','/storage/area/amenity/img14.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(158,'上質な非日常空間','section02-2','02 ラ・フォル・ジュルネ／丸の内ミュージックフェス','single','02 ラ・フォル・ジュルネ／丸の内ミュージックフェス',NULL,NULL,'丸の内では毎年ゴールデンウィークに音楽にまつわるイベントを開催し、有料・無料の公演を組み合わせて幅広い来街者にお楽しみいただく工夫をしています。\n「ラ・フォル・ジュルネ」の起源は、1995年フランスで誕生したクラシック音楽祭。有料公演のほか、誰でも気軽に演奏を楽しめるオープンプログラムなど数々のイベントが行われ、子どもから大人まで楽しめます。\n「丸の内ミュージックフェス」は、丸の内エリア全体でオーケストラやスペシャルバンド、参加型企画など盛りだくさんのコンテンツが繰り広げられます。',NULL,NULL,'/storage/area/amenity/img15.jpg','/storage/area/amenity/img16.jpg','/storage/area/amenity/img17.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(159,'上質な非日常空間','section02-3','02 三菱一号館美術館','single','三菱一号館美術館',NULL,NULL,'赤煉瓦の建物は、1894年に建設された「三菱一号館」（ジョサイア・コンドル設計）を復元したもの。館内には、\nミュージアムカフェ「cafe1894」、ミュージアムショップ「store1894」、丸の内の歴史体感スペース「歴史資料室」を併設しています。\n（2023年4月10日から 2024年秋まで、設備入替および建物メンテナンスのため長期休館となります。）',NULL,NULL,'/storage/area/amenity/img18.jpg','/storage/area/amenity/img19.jpg','/storage/area/amenity/img20.jpg','/storage/area/amenity/img21.jpg',NULL,'/storage/area/amenity/img18_sp.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(160,'上質な非日常空間','section02-4','02 GEIDAI ARTS in Marunouchi','single','三菱一号館美術館',NULL,NULL,'「藝大アーツイン丸の内」とは東京藝術大学と三菱地所が共同主催して行うイベントです。「文化・芸術」は、社会の基盤であると考え、その基盤づくりを目的とする東京藝術大学と、日本を代表するビジネスセンター・丸の内の街づくりを手掛ける三菱地所がコラボレーションすることにより、「文化・芸術にあふれ、創造性豊かな街づくり」を発信していきます。',NULL,NULL,'/storage/area/amenity/img22.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(161,'上質な非日常空間','section03','03 アート・音楽との触れ合い','single',NULL,NULL,NULL,'丸の内仲通りを中心に、国内外のファッションブランドをはじめとする高感度なショップや個性豊かなカフェ、\nレストランなどが数多く出店しています。',NULL,NULL,'/storage/area/amenity/maps.jpg',NULL,NULL,NULL,NULL,'/storage/area/amenity/maps_sp.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(162,'上質な非日常空間','section04','04 憩いの場','single',NULL,NULL,NULL,'仕事の合間のリフレッシュや、休日のリラックスタイムに最適な空間が、丸の内には多数あります。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(163,'上質な非日常空間','section04-1','04 憩いの場','single',NULL,NULL,NULL,NULL,NULL,NULL,'/storage/area/amenity/img23.jpg','/storage/area/amenity/img24.jpg','/storage/area/amenity/img25.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(164,'上質な非日常空間','section04-2','04 丸の内仲通りアーバンテラス','single','丸の内仲通りアーバンテラス',NULL,NULL,'アーバンテラスとは、丸の内仲通りにて平日11時～15時、土日祝11時～17時で道路を歩行者に開放する取り組みです。\n丸の内仲通りの道路空間を活用し、椅子やテーブルを設置するほか、キッチンカーも出店。\nエリアワーカーのランチや休憩の場として、屋外空間提供を推進しております。',NULL,NULL,'/storage/area/amenity/img5.jpg','/storage/area/amenity/img6.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(165,'上質な非日常空間','section05','05 Well-Beingに関する取り組み','single',NULL,NULL,NULL,'多様な企業・人が集まる丸の内エリアにて、企業の枠を越え、エリア全体でWell-Being（健康・幸福）の取り組みを推進しています。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(166,'上質な非日常空間','well-being','05 丸の内ヘルスカンパニー','multiple','丸の内ヘルスカンパニー',NULL,NULL,'三菱地所が2019年4月より提供を開始した、健康意識・行動の活性化を企図したスマートフォンアプリ。「年功序列から健康序列へ」を合言葉とする架空の会社「丸の内ヘルスカンパニー」に、無料アプリをダウンロードすることで誰でも“入社”することが可能。アプリ上で日々の運動、体重や血圧などの健康データの計測、関連イベントへの参加等により「ヘルスポイント」が貯まり、ユーザーは獲得したポイントに応じて昇進し、昇進するほどより多くの健康アクティビティに参加できる仕組みとなっています。',NULL,NULL,'/storage/area/amenity/img26.jpg',NULL,NULL,NULL,NULL,'/storage/area/amenity/img26_sp.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://health-company.jp/',0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(167,'上質な非日常空間','well-being','05 EAT＆LEAD','multiple','EAT＆LEAD',NULL,NULL,'生産者・消費者・レストランが共に手を携え、人々が心身共に健康になれる社会づくりを目指し、2008年より「食」に関する様々な活動を行ってきた「食育丸の内」プロジェクト。より一層、「食」を通じて一人ひとりの本来的な幸せと成長に向き合える場作りを“リード”し“伴走”をしていきたいという想いから、2021年6月より「EAT＆LEAD（イートアンドリード）」として再始動しました。',NULL,NULL,'/storage/area/amenity/img27.jpg',NULL,NULL,NULL,NULL,'/storage/area/amenity/img27_sp.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://shokumaru.jp/eat-and-lead/',0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(168,'上質な非日常空間','well-being','05 Will Conscious Marunouchi','multiple','Will Conscious Marunouchi',NULL,NULL,'働く世代の女性にむけて、より充実した明日への選択肢を共に学び、サポートすることを目指した「Will Conscious Marunouchi」プロジェクト。「まるのうち保健室」調査から得られた情報や声を生かし、街づくりを通じて、様々な企業と協創し、女性が健康的に美しく長く働ける社会のためのモデルケースづくりを目指しています。',NULL,NULL,'/storage/area/amenity/img28.jpg',NULL,NULL,NULL,NULL,'/storage/area/amenity/img28_sp.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'https://wcm.moala.live/',0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(169,'丸の内の挑戦と歴史','lead','見出し','single',NULL,NULL,NULL,'日本のビジネスの中心地として発展を遂げ、日本の玄関口としての役割も担っている丸の内エリア。\nビジネスセンターとしての歴史は、1890年から始まります。\n明治の産業近代化に伴い建てられた赤レンガ群、戦後の高度経済成長期に進んだ大規模ビルへの建替、\nそして現在、丸の内を“人・企業が集まり交わることで新たな「価値」を生み出す舞台”とすることを目指し、\n「丸の内 NEXTステージ」の推進に取り組んでいます。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(170,'丸の内の挑戦と歴史','section-edo','江戸時代','single',NULL,NULL,NULL,'江戸開府以来、日本の政治・経済・文化の中心となった江戸城。\n丸の内のオフィス街はかつて、江戸城を護り幕府の繁栄を支えた諸国の大名屋敷が立ち並ぶ街並みでした。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(171,'丸の内の挑戦と歴史','section00','00 ゼロからの出発','single','丸の内取得と一大ビジネス街への夢',NULL,NULL,'丸の内の歴史は、当時三菱社の社長であった岩崎彌之助が、明治政府からの要請を受け、\n丸の内一帯を取得した1890年からスタートします。\n当時、草が生い茂り原野と化した丸の内一帯は「三菱ヶ原」と呼ばれました。\nしかし取得の背景には「日本が近代国家の道を歩むためには、\nニューヨークやロンドンのようなビジネスセンターをつくる必要がある」という彌之助の確信があったのです。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(172,'丸の内の挑戦と歴史','section01','01 第一次開発','single','本格的な ビジネスセンターの幕開け',NULL,NULL,'丸の内エリアに初めての近代的オフィスビル「三菱第一号館」が\n竣工したのは1894年のことです。その後、赤煉瓦造りの3階建てオフィスビルが\n次々と建設され、ロンドンを彷彿とさせる街並みは、\n「一丁倫敦（ロンドン）」と呼ばれました。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(173,'丸の内の挑戦と歴史','section01-list','1894 三菱一号館竣工','multiple','1894','三菱一号館竣工',NULL,'ジョサイア・コンドルにより西洋風の外観を持つ煉瓦造の建築物として設計。煉瓦造の建物内に会社や銀行が入居した丸の内初のオフィスビル。',NULL,NULL,'/storage/area/history/sec2_img1.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(174,'丸の内の挑戦と歴史','section01-list','1914 東京駅開業','multiple','1914','東京駅開業',NULL,'新橋と上野を結ぶ高架鉄道の建設が立案され、その新線の中央停車場として、皇居前の原野に誕生。「東京駅」と命名された。',NULL,NULL,'/storage/area/history/sec2_img2.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(175,'丸の内の挑戦と歴史','section01-list','1923 丸ノ内ビル竣工','multiple','1923','丸ノ内ビル竣工',NULL,'現在では珍しくないオフィスビルの商業施設も、日本においては丸ビルが先駆的に導入。昭和における戦前期での国内最大のビルとして誕生。',NULL,NULL,'/storage/area/history/sec2_img3.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(176,'丸の内の挑戦と歴史','section01-list','1920s 一丁倫敦 ／ 一丁紐育','multiple','1920s','一丁倫敦 ／ 一丁紐育',NULL,'三菱一号館を皮切りに、次々に赤煉瓦造りで統一された洋風オフィス街ビルが建設され、その建ち並ぶ様は「一丁倫敦」と呼ばれた。また、丸ビル完成後のアメリカ式のビルが並んだ行幸通り一帯は「一丁紐育」と呼ばれ、ビジネスセンターの先駆けとなった。',NULL,NULL,'/storage/area/history/sec2_img4.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(177,'丸の内の挑戦と歴史','section01-list','1933 東京中央郵便局 新局舎　開業','multiple','1933','一丁倫敦 ／ 一丁紐育',NULL,'近代郵便制度発足時に大阪郵便役所、西京郵便役所（京都）と共に設立された「四日市郵便役所」の新局舎として丸の内駅舎南口前に誕生。（竣工は1931年）',NULL,NULL,'/storage/area/history/sec2_img5.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(178,'丸の内の挑戦と歴史','section02','02 第二次開発','single','高度経済成長に伴う オフィスビルの大量供給・ 高容積化',NULL,NULL,'高度経済成長期を迎えると、丸の内のオフィス需要は急激に高まりました。\n1959年に策定された「丸ノ内総合改造計画」によって、大量供給・ 高容積化に向けた大規模オフィスビルへの建て替えが始まります。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(179,'丸の内の挑戦と歴史','section02-list','1960 丸の内駐車場オープン','multiple','1960','丸の内駐車場オープン',NULL,'ビジネス街にあふれる車を収容する施設が必要だったため、行幸通りを掘り起こして地下2階520台収容の「丸の内駐車場」が設けられた。',NULL,NULL,'/storage/area/history/sec4_img1.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(180,'丸の内の挑戦と歴史','section02-list','1960s 丸の内仲通りの整備','multiple','1960s','丸の内仲通りの整備',NULL,'人や車の往来増加に伴い、丸の内仲通りの道幅を13mから21mへ拡幅。',NULL,NULL,'/storage/area/history/sec4_img2.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(181,'丸の内の挑戦と歴史','section03','03 第三次開発','single','丸の内を「世界で最もインタラクションが活発な街」へ',NULL,NULL,'三菱地所は1998年より、「世界で最もインタラクションが活発な街」をコンセプトとした\n新しい都市機能の創造への取り組み「丸の内再構築」をスタートしました。\n2002年竣工の「丸の内ビル」の完成を皮切りに多くのビルの建て替えを 実現。\nその後、丸の内の活気と賑わいを大手町、有楽町へと拡大し、\nビ ジネス機能を深化させるとともに、街の機能の多様性を拡げました。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(182,'丸の内の挑戦と歴史','section03-list','2002 丸ビル建替','multiple','1960','丸ビル建替',NULL,'約80年の時を経て、古くなった丸ビルを、国内屈指のビジネスセンターとなった丸の内の再開発プロジェクトの第一弾として建て替え。',NULL,NULL,'/storage/area/history/sec6_img1.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#',0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(183,'丸の内の挑戦と歴史','section03-list','2004 丸の内オアゾ（OAZO） 開業','multiple','2004','丸の内オアゾ（OAZO） 開業',NULL,'旧日本国有鉄道本社ビル跡地の大規模再開発プロジェクト。複数のオフィスビルと複合商業施設・ホテルを含む丸の内の新名所として誕生。',NULL,NULL,'/storage/area/history/sec6_img2.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#',0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(184,'丸の内の挑戦と歴史','section03-list','2010 三菱一号館美術館開業','multiple','2010','三菱一号館美術館開業',NULL,'2009 年、丸の内再構築の一環である丸の内パークビルディングの開発にあわせ、三菱一号館を復元。2010 年に、カフェも併設された「三菱一号館美術館」として開業。',NULL,NULL,'/storage/area/history/sec6_img3.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#',0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(185,'丸の内の挑戦と歴史','section03-list','2012 東京駅駅舎建替','multiple','2012','東京駅駅舎建替',NULL,'1914年に開業した国指定重要文化財である丸の内駅舎が創建当時の姿に復原された。',NULL,NULL,'/storage/area/history/sec6_img4.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(186,'丸の内の挑戦と歴史','section03-list','2016 大手町フィナンシャルシティグランキューブ竣工','multiple','2016','大手町フィナンシャルシティグランキューブ竣工',NULL,'旧日本国有鉄道本社ビル跡地の大規模再開発プロジェクト。複数のオフィスビルと複合商業施設・ホテルを含む丸の内の新名所として誕生。',NULL,NULL,'/storage/area/history/sec6_img5.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#',0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(187,'丸の内の挑戦と歴史','section03-list','2017 大手町パークビル竣工','multiple','2017','大手町パークビル竣工',NULL,'皇居の大手門前の立地に、商業および、約2,800㎡の緑豊かな「ホトリア広場」を併設したオフィスビルが誕生。上層部にはサービスアパートメントが開業し、職住隣接の新しいライフスタイルを提案。',NULL,NULL,'/storage/area/history/sec6_img6.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#',0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(188,'丸の内の挑戦と歴史','section03-list','2018 丸の内二重橋ビル','multiple','2018','丸の内二重橋ビル',NULL,'水と緑の景観が広がる皇居外苑と商業・文化色の色濃い銀座・日比谷・有楽町と近接。東京商工会議所や東京會舘を低層部に構え、歴史を紡いできた高い「格式」に加えて、商業・文化の香り漂う「華やかさ」も有する大規模オフィスビル。',NULL,NULL,'/storage/area/history/sec6_img7.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#',0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(189,'丸の内の挑戦と歴史','section04','04 丸の内NEXTステージ','single','丸の内再構築の更なる「 拡がり」と「深まり」を目指す',NULL,NULL,'2020年代以降のまちづくりを「丸の内NEXTステージ」と位置付け、\n人・企業が集まり交わることで新たな「価値」を生み出す舞台を目指し ます。\nまた、有楽町エリア及び常盤橋エリアを重点更新エリアとし、 再開発やリノベー ションを推進します。 ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(190,'丸の内の挑戦と歴史','section04-list','2021 TOKYO TORCH 常盤橋タワー竣工','multiple','2021','TOKYO TORCH 常盤橋タワー竣工',NULL,'東京駅周辺で最大となる敷地面積3.1haに及ぶ大規模複合再開発「TOKYO TORCH」。その第一弾プロジェクトとして、「常盤橋タワー」が竣工。',NULL,NULL,'/storage/area/history/sec8_img1.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'#',0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(191,'丸の内の挑戦と歴史','section04-list','2027 TOKYO TORCH Torch Tower竣工予定','multiple','2027','TOKYO TORCH Torch Tower竣工予定',NULL,'2027年度、多彩な賑いと交流を創出するグローバルな拠点づくりを目指して、東京の新たなランドマークとなる高さ390ｍの超高層タワー「Torch Tower」が竣工予定。併せて、東京駅前の新たな顔となる約7,000㎡の大規模広場等を整備予定。',NULL,NULL,'/storage/area/history/sec8_img2.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'',0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(192,'オフィス移転ガイド','lead','見出し','single',NULL,NULL,NULL,'オフィス物件の検索・お問い合わせから、\nご契約・移転までの流れをご紹介いたします。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(193,'オフィス移転ガイド','section01','01 オフィス移転の流れ 画像','single',NULL,NULL,NULL,NULL,NULL,NULL,'/storage/step/step_content.png',NULL,NULL,NULL,NULL,'/storage/step/step_content_sp.png',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(194,'オフィス移転ガイド','section02-1','02-01 物件検索 / お問い合わせ','single',NULL,NULL,NULL,'気になる物件は「お気に入り物件」に登録することで、空き状況をスムーズにご確認いただけます。\n空室がない物件は「空室お知らせメール」に登録することで、\n空室発生時にメールでお知らせをお受け取りいただけます。','気になるオフィス物件がございましたらお気軽にお問い合わせください。\nより詳細な情報をお知らせいたします。\nまた、ご要望をもとに最適な物件をご提案させていただくことも可能です。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(195,'オフィス移転ガイド','section02-2','02-02 物件見学・内覧','single','約200坪のレイアウトイメージ',NULL,NULL,'物件の周辺環境・眺望・区画の形状など、実際にご見学いただくことで、\nサイトだけではお伝えしきれない魅力をご体感いただけます。\n同じ面積であっても形状によって最適なレイアウトが変わってきます。\n物件に精通した当社担当者がご案内させていただきますので、お気軽にお問い合わせください。','ご見学いただきながら、会議室や席数などのレイアウトイメージをご案内いたします。',NULL,'/storage/step/step2_img1.jpg','/storage/step/step2_img2.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'自由なレイアウトでクリエイティビティを高めるオフィス','スペース効率の高いアイランド型オフィス',NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(196,'オフィス移転ガイド','section02-3','02-03 お申し込み、ご契約','single','約200坪のレイアウトイメージ',NULL,NULL,'物件をご決定されましたら、所定の申込書をご提出いただき、契約を締結いたします。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(197,'オフィス移転ガイド','section02-4','02-03 レイアウト検討','single',NULL,NULL,NULL,'物件ごとにレイアウトのサンプルをご用意していますので、各物件のページよりご確認ください。\nまた、レイアウトに関するご提案も可能ですので、お気軽にお問合せください。',NULL,NULL,'/storage/step/step4_img1.jpg','/storage/step/step4_img2.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(198,'オフィス移転ガイド','section02-5','02-03 入居工事、移転','single','約200坪のレイアウトイメージ',NULL,NULL,'三菱地所グループでは移転に関する各種サポート（什器選定、スケジュール調整、入居工事、入居後の各種届出等）を\nご提供しております。',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,0,1,'2023-05-10 06:44:24',NULL,'127.0.0.1','2023-05-10 06:44:24',NULL,'127.0.0.1',NULL,NULL,NULL),(199,'特集物件','feature','さおりん','multiple','通信手 武部沙織',NULL,NULL,'県立大洗女子学園に通う2年生。西住みほ・五十鈴華とは同じクラスであり、冷泉麻子とは幼なじみの関係にある。得意教科は家庭科で料理も得意。\r\n視力が悪く、普段はコンタクトレンズを付けているようで本編2話ではコンタクトからメガネにチェンジする彼女の姿が見れる。料理など、家にいるときは眼鏡を掛けていることが多い。\r\nあんこうチーム＜Ⅳ号戦車D型＞では通信手を担当。また、決勝戦を前に第二級アマチュア無線技士免許を取得。（アマチュア無線技士の資格ではこの手の通信はアウトのような気がするし、陸技・陸特・総通とかの資格ではないとダメな気がするが気にしてはいけないのだろう。）\r\n\r\n引っ込み思案のためいまいち友達が出来なかった西住みほに友人である五十鈴華と共に声をかけ、その後すぐに打ち解けるなど人付き合いが上手い。みほのことを「みぽりん」と呼んでいることから、ファンからは「さおりん」の愛称で親しまれている。\r\n通信士というポジションに収まったのも誰とでも仲良くなれるからとのみほからの意見によってである。（最初の訓練時だけくじ引きの結果車長をしていた）\r\n西住みほが生徒会によって強制的に戦車道を選ばされそうになった時は五十鈴華と一緒に文句を言いに行ったり、朝が弱い冷泉麻子のためにわざわざ迎えに行ったりと面倒見が良い。\r\n戦車に関しては物語開始当初、全くの素人でありドイツ語で戦車前進を意味するパンツァーフォーを「パンツのアホー！？」と聞き間違えたり、汚れるからとの理由でⅣ号戦車を土足禁止にしようとして冷泉麻子に「やり過ぎだ」と突っ込まれたりしていた。\r\n学生寮で暮らしているが、実家には両親と妹がいる。しかし、あんこうチームの中で唯一家族が登場しておらず、彼女の家庭環境は意外に謎が多い。\r\n\r\n彼女の特別目立った面としては、非常に恋愛願望ならびに結婚願望が強いと言うところがある。\r\nそのせいか何でも恋愛ごとに絡めて例えたりしているが、実際のところの恋愛経験は皆無のようで所謂『恋に恋している』状態である。1年生には彼氏がいたかを聞かれて落ち込み、後輩たちに慰められる一面もあった。\r\nそもそも、戦車道を始めた理由も「モテモテになれそうだから」だったり、高校2年生ながら結婚情報誌を読むという30代独身女性のような趣味があったり、男を落とすために料理スキルを磨くなど色恋事に対していかに重度の憧れを抱いているかが伺える。\r\n極めつけは公式で配信中のサウンドドラマ（武部沙織編）であり、彼女の人となりが遺憾なく発揮されたその様はまるで婚活中の女性かなにかのようである。そのため、ネットでは婚活戦士ゼクシィ武部と呼ばれることも･･･\r\nついでに言うと彼女のキャラクターソングCDの歌詞もこれまた壮絶にピンク色なものになっているので興味がある人は調べてみるといいかもしれない。',NULL,NULL,'/storage/library/TbAJiHp67IIX6trCT6QBRvyaGGmCuo0sRTvJ8qQp.jpg',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'/search/detail/011402/',0,6,0,'2023-05-31 13:10:15',1,'192.168.100.31','2023-05-31 14:23:41',1,'192.168.100.31','2023-05-31 14:23:41',1,'192.168.100.31'),(200,'特集物件','archive','さおりん','multiple','やっぱりさおりん',NULL,NULL,'県立大洗女子学園に通う2年生。西住みほ・五十鈴華とは同じクラスであり、冷泉麻子とは幼なじみの関係にある。得意教科は家庭科で料理も得意。\r\n視力が悪く、普段はコンタクトレンズを付けているようで本編2話ではコンタクトからメガネにチェンジする彼女の姿が見れる。料理など、家にいるときは眼鏡を掛けていることが多い。\r\nあんこうチーム＜Ⅳ号戦車D型＞では通信手を担当。また、決勝戦を前に第二級アマチュア無線技士免許を取得。（アマチュア無線技士の資格ではこの手の通信はアウトのような気がするし、陸技・陸特・総通とかの資格ではないとダメな気がするが気にしてはいけないのだろう。）\r\n\r\n引っ込み思案のためいまいち友達が出来なかった西住みほに友人である五十鈴華と共に声をかけ、その後すぐに打ち解けるなど人付き合いが上手い。みほのことを「みぽりん」と呼んでいることから、ファンからは「さおりん」の愛称で親しまれている。\r\n通信士というポジションに収まったのも誰とでも仲良くなれるからとのみほからの意見によってである。（最初の訓練時だけくじ引きの結果車長をしていた）\r\n西住みほが生徒会によって強制的に戦車道を選ばされそうになった時は五十鈴華と一緒に文句を言いに行ったり、朝が弱い冷泉麻子のためにわざわざ迎えに行ったりと面倒見が良い。\r\n戦車に関しては物語開始当初、全くの素人でありドイツ語で戦車前進を意味するパンツァーフォーを「パンツのアホー！？」と聞き間違えたり、汚れるからとの理由でⅣ号戦車を土足禁止にしようとして冷泉麻子に「やり過ぎだ」と突っ込まれたりしていた。\r\n学生寮で暮らしているが、実家には両親と妹がいる。しかし、あんこうチームの中で唯一家族が登場しておらず、彼女の家庭環境は意外に謎が多い。\r\