DROP TABLE IF EXISTS `inquiries`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `inquiries` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `inquiry_type` int(11) NOT NULL COMMENT '問合せ内容 空室 / 内覧希望 / 物件提案依頼 / その他 モデルに記載',
  `inquiry_category` int(11) DEFAULT NULL COMMENT '問い合わせ分類',
  `inquiry_sub_category` varchar(255) DEFAULT NULL COMMENT '問い合わせ分類サブカテゴリ',
  `company_name` varchar(255) NOT NULL COMMENT '会社名',
  `sender_name` varchar(255) NOT NULL COMMENT '担当者名',
  `email` varchar(255) NOT NULL COMMENT 'メールアドレス',
  `zipcode` varchar(255) DEFAULT NULL COMMENT '郵便番号',
  `pref_id` varchar(255) DEFAULT NULL COMMENT '都道府県',
  `address1` varchar(255) DEFAULT NULL COMMENT '市区町村',
